import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import '../css/Layout.css';

const Layout = ({ children }) => {
  const [nombre, setNombre] = useState(localStorage.getItem('nombre'));
  const [rol, setRol] = useState(localStorage.getItem('rol'));
  const [menuAbierto, setMenuAbierto] = useState(false);
  const isLoggedIn = !!rol;

  useEffect(() => {
    const onStorage = () => {
      setNombre(localStorage.getItem('nombre'));
      setRol(localStorage.getItem('rol'));
    };
    window.addEventListener('storage', onStorage);
    return () => window.removeEventListener('storage', onStorage);
  }, []);

  const handleLogout = () => {
    localStorage.clear();
    window.dispatchEvent(new Event('storage'));
    window.location.href = '/';
  };

  const toggleMenu = () => {
    setMenuAbierto(!menuAbierto);
  };

  return (
    <div className="layout">
      <nav className="navbar-custom">
        <div className="nav-left">
          <Link to="/" className="brand">
            <span role="img" aria-label="logo">üöÅ</span>Dron<span className="brand-highlight">Medico</span>
          </Link>

          <button className="hamburger" onClick={toggleMenu}>
            {menuAbierto ? '‚úñÔ∏è' : '‚ò∞'}
          </button>
        </div>

        <div className={`nav-links-custom ${menuAbierto ? 'show' : ''}`}>
          <Link to="/" onClick={() => setMenuAbierto(false)}>Inicio</Link>
          <Link to="/registro-envios" onClick={() => setMenuAbierto(false)}>Registro de envios</Link>
          <Link to="/drones" onClick={() => setMenuAbierto(false)}>Drones</Link>
          <Link to="/alertas" onClick={() => setMenuAbierto(false)}>Alertas</Link>
          <Link to="/historial" onClick={() => setMenuAbierto(false)}>Historial</Link>
          <Link to="/usuario" onClick={() => setMenuAbierto(false)}>Usuario</Link>

          {!isLoggedIn && (
            <>
              <Link to="/login" className="nav-btn login-btn" onClick={() => setMenuAbierto(false)}>
                <span role="img" aria-label="login">üîë</span> Iniciar sesi√≥n
              </Link>
              <Link to="/registrar" className="nav-btn register-btn" onClick={() => setMenuAbierto(false)}>
                <span role="img" aria-label="register">üë§</span> Registrarse
              </Link>
            </>
          )}
          {isLoggedIn && (
            <>
              <span className="nav-btn user-info">
                <span role="img" aria-label="user">üë§</span> {nombre || 'Usuario'}
              </span>
              <button className="nav-btn logout-btn" onClick={() => { handleLogout(); setMenuAbierto(false); }}>
                <span role="img" aria-label="logout">üö™</span> Cerrar sesi√≥n
              </button>
            </>
          )}
        </div>
      </nav>

      <main className="main-content">
        {children}
      </main>

      <footer className="footer-custom">
        <div className="footer-content">
          {/* Secci√≥n 1: Informaci√≥n de la empresa */}
          <div className="footer-section">
            <div className="footer-brand">
              <span role="img" aria-label="drone">üöÅ</span>
              <span className="brand-highlight">DronMedico</span>
            </div>
            <p className="footer-description">
              Sistema avanzado de drones m√©dicos para entregas r√°pidas y seguras de medicamentos y suministros m√©dicos.
            </p>
            <div className="footer-social">
              <a href="https://www.facebook.com" className="social-link facebook" target="_blank" rel="noopener noreferrer">
                üìò
              </a>
              <a href="https://www.instagram.com" className="social-link instagram" target="_blank" rel="noopener noreferrer">
                üì∑
              </a>
              <a href="https://wa.me/51935532263" className="social-link whatsapp" target="_blank" rel="noopener noreferrer">
                üì±
              </a>
              <a href="https://www.twitter.com" className="social-link twitter" target="_blank" rel="noopener noreferrer">
                üê¶
              </a>
            </div>
          </div>

          {/* Secci√≥n 2: Enlaces r√°pidos */}
          <div className="footer-section">
            <h4>Enlaces R√°pidos</h4>
            <ul className="footer-links">
              <li><Link to="/">üè† Inicio</Link></li>
              <li><Link to="/registro-envios">üì¶ Registro de Env√≠os</Link></li>
              <li><Link to="/drones">üöÅ Gesti√≥n de Drones</Link></li>
              <li><Link to="/alertas">üö® Centro de Alertas</Link></li>
              <li><Link to="/historial">üìä Historial M√©dico</Link></li>
              <li><Link to="/usuario">üë§ Perfil de Usuario</Link></li>
            </ul>
          </div>

          {/* Secci√≥n 3: Contacto e informaci√≥n */}
          <div className="footer-section">
            <h4>Contacto & Soporte</h4>
            <ul className="footer-contact">
